import React from 'react'
import { BrowserRouter, Route } from "react-router-dom";
import Sidebar from './Sidebar.js'
import ArticleList from './ArticleList.js'
import ArticleView from './ArticleView.js'
import './Dashboard.css'

export default class Dashboard extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
          articles: [
              {id: 1, headline: "a string", summary: "", tags:["Front-End Development", "Responsive Design", "UX"], categories:["Tutorial"]},
          {id: 2, headline: "another string", summary: "", tags:["Back-End Development", "Node", "Express"], categories:["News", "New Technology"]},
          {id: 3, headline: "a string", summary: "", tags:["React", "Node", "Express"], categories:["Tutorial"]},
        ],
        };
      }
    
    render() {
        return (<section id="dashboardContainer">
            <section id="Header">Header</section>
            <section id="navbar"></section>
           <Sidebar />
           <BrowserRouter>
        <Route exact path={'/dashboard'} component={ArticleList} />
        <Route path={'/dashboard/article'} component={ArticleView} />
              </BrowserRouter>
            </section>
        );
    }
}
